import React ,{useEffect,useState}from "react";
import "./NextPage.css";
import axios from "axios";
export default function NextPage() {
  const [, setScienceFictionItems] = useState([]);
  // const dispatch = useDispatch()

  useEffect(() => {
    axios
      .get("https://child.onrender.com/api/sciencefiction")
      .then((response) => {
        setScienceFictionItems(response.data.slice(0, 8));
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []);
  return (
    <>
      <h1>
        <span>The Lost City Of </span>Future Earth
      </h1>

      <div id="NextButtons">
        <button>Word Explorer</button>
        <button>Story Adventure</button>
        <button>Brain Quest</button>
      </div>

      <p>
        Drag Pictures to the matching Words, light up correct pairs, shake for a
        retry
      </p>

      <div id="LeftBox">
        <h3>
          Correction(noun)
        </h3>
      </div>
    </>
  );
}
